package com.redhat.coolstore.utils;

import com.redhat.coolstore.model.CatalogItemEntity;
import com.redhat.coolstore.model.Order;
import com.redhat.coolstore.model.OrderItem;
import com.redhat.coolstore.model.Product;
import com.redhat.coolstore.model.ShoppingCart;
import java.io.StringReader;
import java.io.StringWriter;
import java.util.ArrayList;
import java.util.List;
import jakarta.json.bind.Jsonb;
import jakarta.json.bind.JsonbBuilder;
import jakarta.json.bind.JsonbException;

import java.util.concurrent.ThreadLocalRandom;
import java.util.logging.Logger;

/**
 * Created by tqvarnst on 2017-03-30.
 */
public class Transformers {

    private static final String[] RANDOM_NAMES = {"Sven Karlsson","Johan Andersson","Karl Svensson","Anders Johansson","Stefan Olson","Martin Ericsson"};
    private static final String[] RANDOM_EMAILS = {"sven@gmail.com","johan@gmail.com","karl@gmail.com","anders@gmail.com","stefan@gmail.com","martin@gmail.com"};

    private static Logger log = Logger.getLogger(Transformers.class.getName());

    public static Product toProduct(CatalogItemEntity entity) {
        Product prod = new Product();
        prod.setItemId(entity.getItemId());
        prod.setName(entity.getName());
        prod.setDesc(entity.getDesc());
        prod.setPrice(entity.getPrice());
        if (entity.getInventory() != null) {
            prod.setLocation(entity.getInventory().getLocation());
            prod.setLink(entity.getInventory().getLink());
            prod.setQuantity(entity.getInventory().getQuantity());
        } else {
            log.warning("Inventory for " + entity.getName() + "[" + entity.getItemId()+ "] unknown and missing");
        }
        return prod;
    }

    public static String shoppingCartToJson(ShoppingCart cart) {
        Jsonb jsonb = JsonbBuilder.create();
        ShoppingCartJson cartJson = new ShoppingCartJson();
        cartJson.setOrderValue(cart.getCartTotal());
        cartJson.setCustomerName(RANDOM_NAMES[ThreadLocalRandom.current().nextInt(RANDOM_NAMES.length)]);
        cartJson.setCustomerEmail(RANDOM_EMAILS[ThreadLocalRandom.current().nextInt(RANDOM_EMAILS.length)]);
        cartJson.setRetailPrice(cart.getShoppingCartItemList().stream().mapToDouble(i -> i.getQuantity()*i.getPrice()).sum());
        cartJson.setDiscount(cart.getCartItemPromoSavings());
        cartJson.setShippingFee(cart.getShippingTotal());
        cartJson.setShippingDiscount(cart.getShippingPromoSavings());
        cartJson.setItems(cart.getShoppingCartItemList().stream().map(item -> new ShoppingCartItemJson(item.getProduct().getItemId(), item.getQuantity())).toList());
        return jsonb.toJson(cartJson);
    }

    public static Order jsonToOrder(String json) {
        Jsonb jsonb = JsonbBuilder.create();
        ShoppingCartJson cartJson = jsonb.fromJson(json, ShoppingCartJson.class);
        Order order = new Order();
        order.setCustomerName(cartJson.getCustomerName());
        order.setCustomerEmail(cartJson.getCustomerEmail());
        order.setOrderValue(cartJson.getOrderValue());
        order.setRetailPrice(cartJson.getRetailPrice());
        order.setDiscount(cartJson.getDiscount());
        order.setShippingFee(cartJson.getShippingFee());
        order.setShippingDiscount(cartJson.getShippingDiscount());
        List<OrderItem> items = cartJson.getItems().stream().map(item -> new OrderItem(item.getProductId(), item.getQuantity())).toList();
        order.setItemList(items);
        return order;
    }

